PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
SELECT DISTINCT ?uri 
WHERE {
        ?uri rdf:type dbo:Person . 
        ?uri dbo:weight ?num . 
      { ?uri dbp:team res:Chicago_Bulls . }
      UNION 
      { ?uri dbp:draftTeam res:Chicago_Bulls . }
      UNION 
      { ?uri dbo:draftTeam res:Chicago_Bulls . }
} 
ORDER BY DESC(?num) 
OFFSET 0 LIMIT 1

